import Personal from "./Personal";
import WrapperComponent from "./WrapperComponent";

const PersonalDetails = WrapperComponent(Personal);
function Hoc(props) {
  return (
    <>
      <h4>Hoc</h4>
      <div className="section">
        <fieldset>
          <legend>Personal</legend>
          <PersonalDetails />
        </fieldset>
        <fieldset>
          <legend>Address</legend>
        </fieldset>
        <fieldset>
          <legend>Employment</legend>
        </fieldset>
      </div>
    </>
  );
}

export default Hoc;
